"use strict";let pagina="0";const faq={init:()=>{console.log("Start"),faq.cargarItems()},cargarItems:()=>{let n={};n.path=window.location.hostname;n.idUsuario=sessionStorage.getItem("idusuario");n=JSON.stringify(n);$.ajax({type:"POST",url:"../pages/web/FAQ.aspx/GetListaItemsPublic",data:n,contentType:"application/json; charset=utf-8",dataType:"json","async":!0,success:function(n){let i=n.d,t="";i.forEach(n=>{t+=`
                            <div>
                                <div style="margin-top: 20px;">
                                <strong>
                                ${n.Pregunta}
                                </strong>
                            </div>
                            <div>
                                ${n.Respuesta}
                            </div>
                    `});$("#loadItems").html(t)},error:function(n,t){console.log(t+": "+n.responseText)}})}};window.addEventListener("load",()=>{faq.init()});